import React, { useState } from 'react';
import Navbar from './Navbar/Navbar';

function Home() {
    const [dashboard, setDashboard] = useState<boolean>(true);
    const [data, setData] = useState<boolean>(false);
    const [charts, setCharts] = useState<boolean>(true);
    const [table, setTable] = useState<boolean>(false);

    const showDashboard = () => {
        setDashboard(true);
        setData(false);
    }

    const showData = () => {
        setData(true);
        setDashboard(false);
    }

    const showCharts = () => {
        setCharts(true);
        setTable(false);
    }

    const showTable = () => {
        setTable(true);
        setCharts(false);
    }

    return (
        <div>
            <Navbar 
                dashboard={dashboard}
                data={data}
                showDashboard={showDashboard}
                showData={showData}
                showCharts={showCharts}
                showTable={showTable}
            />
        </div>
    );
}

export default Home;
